import React from "react";

function DriveVideoEmbed() {
    const ref = React.useRef();
    const [height, setHeight] = React.useState("0px");
    const onLoad = () => {
      setHeight(ref.current.contentWindow.document.body.scrollHeight + "px");
    };
    return (
      <iframe
        ref={ref}
        onLoad={onLoad}
        id="myFrame"
        src="https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview"
        width="100%"
        height={height}
        style={{
          maxWidth: 640,
          width: "100%",
          overflow: "auto",
        }}
      ></iframe>
    );
  }

export default DriveVideoEmbed;
